var Friends = [];

const style = {
	img: {
			height:"200px",
			margin: "10px auto",
			display: "block"
		},
	input: {
		width: "250px",
		display: "block",
		margin: "25px auto"
	}
	};
var Contact = React.createClass({
	
	render: function(){
		return (
			<div className="col-sm-6 col-md-4">
				<div className="thumbnail">
					<img src={this.props.image} alt="100%x200" style={style.img} />
					<div className="caption">
						<h3>{this.props.name}</h3>
						<p>{this.props.phone}</p>
						<p><a href="#" className="btn btn-primary" role="button">Button</a> 
						<a href="#" className="btn btn-default" role="button">Button</a></p>
					</div>					
				</div>
			</div>
		);
	}
})
var ContactList = React.createClass({
	getInitialState: function(){
		return {
			displayedContacts: Friends
		};	
	},
	handleSearch: function(event){
		var searchQuery = event.target.value.toLowerCase();
		var displayedContacts = Friends.filter(function(el){
			var searchName = el.first_name.toLowerCase();
			var searchPhone = el.last_name.toLowerCase();
			
			return searchName.indexOf(searchQuery) !== -1 || searchPhone.indexOf(searchQuery) !== -1;
		});
		this.setState({
			displayedContacts: displayedContacts
		});
	},
	componentDidMount: function() {
    // Is there a React-y way to avoid rebinding `this`? fat arrow?
    var th = this;
    this.serverRequest = $.ajax({  
            url: 'http://api.vk.com/method/users.getFollowers?uid=26905714&count=50&fields=photo', // вместо 65762432 указываем свой ID 
            dataType: "jsonp",
			cache: false
        }).done(function(e){th.setState({
            	displayedContacts: e.response.items
          	});
	});    
  	},
	componentWillUnmount: function() {
		this.serverRequest.abort();
	},
  
	render: function(){
		return (
			<div className="container">		
			<div className="row">
				<div className="col-md-12">
					<input type="text" style={style.input} onChange={this.handleSearch} />
				</div>
			</div>
			<div className="row">			
					{
						this.state.displayedContacts.map(function(el){
							return <Contact 
								key={el.uid} 
								name={el.first_name} 
								phone={el.last_name} 
								image={el.photo} 
							/>;
						})
					}				
			</div>
			</div>
		)
	}
});

ReactDOM.render(
  <ContactList />,
  document.getElementById('list')
);



